import React from "react";
import styled from "styled-components";
import Image from "next/image";
import { Container } from "../layout/Container";

export const FullImage = (props) => {
  return (
    <Container>
      <ImageContainer>
        <Image
          src={props.imageSrc}
          layout="fill"
          objectFit="cover"
          {...props}
        />
      </ImageContainer>
    </Container>
  );
};

const ImageContainer = styled.div`
  display: grid;
  position: relative;
  height: 300px;
`;
